components.dataSource:
=$d('local-storage-base-impact-informatique')
.filter((item) => !item.Nom_poste_français)
.reduce((reducedData, item) => {
    reducedData.push({
        name:item.Nom_base_français,
        total:item.Total_poste_non_décomposé,
        distribution:$d('local-storage-base-impact-informatique').filter((element) => (element.Nom_base_français === item.Nom_base_français && element.Nom_attribut_français === item.Nom_attribut_français && element.Nom_poste_français === "Distribution")).reduce((tmp, element) => {tmp.gwp=element.Total_poste_non_décomposé;return (tmp);}, {gwp:0}).gwp,
        supply:$d('local-storage-base-impact-informatique').filter((element) => (element.Nom_base_français === item.Nom_base_français && element.Nom_attribut_français === item.Nom_attribut_français && element.Nom_poste_français === "Approvisionnement")).reduce((tmp, element) => {tmp.gwp=element.Total_poste_non_décomposé;return (tmp);}, {gwp:0}).gwp,
        raw_material:$d('local-storage-base-impact-informatique').filter((element) => (element.Nom_base_français === item.Nom_base_français && element.Nom_attribut_français === item.Nom_attribut_français && element.Nom_poste_français === "Matières premières")).reduce((tmp, element) => {tmp.gwp=element.Total_poste_non_décomposé;return (tmp);}, {gwp:0}).gwp,
        assembly:$d('local-storage-base-impact-informatique').filter((element) => (element.Nom_base_français === item.Nom_base_français && element.Nom_attribut_français === item.Nom_attribut_français && element.Nom_poste_français === "Assemblage")).reduce((tmp, element) => {tmp.gwp=element.Total_poste_non_décomposé;return (tmp);}, {gwp:0}).gwp,
        formatting:$d('local-storage-base-impact-informatique').filter((element) => (element.Nom_base_français === item.Nom_base_français && element.Nom_attribut_français === item.Nom_attribut_français && element.Nom_poste_français === "Mise en forme")).reduce((tmp, element) => {tmp.gwp=element.Total_poste_non_décomposé;return (tmp);}, {gwp:0}).gwp
    })
    if (reducedData[reducedData.length - 1].distribution !== 0)
        reducedData[reducedData.length - 1].total = 0
    return reducedData
},[]).filter((item) => item.name.includes($d('input-0')))
